sample: '["\"\u2022 Roestvrijstalen conditioning doeken \u2022 Brengt het apparaat
  terug in de ''showroom'' staat \u2022 Beschermt het oppervlak voor vingerafdrukken
  en vlekken \u2022 De doeken zijn ge\u00efmpregneerd met speciale olie \u2022 Geschikt
  voor koud/heet en aluminium gecoate oppervlakken (niet voor bedieningsoppervlakken)
  \u2022 5 doeken per pak (individueel verpakt) \u2022 Vervangt de doeken die eerder
  werden verkocht (onderdeel nummer 461554)\\nWij maken gebruik van cookies om onze
  website te verbeteren, om het verkeer op de website te analyseren, om de website
  naar behoren te laten werken en voor de koppeling met social media. Door op Ja te
  klikken, geef je toestemming voor het plaatsen van alle cookies zoals omschreven
  in onze privacy- en cookieverklaring.\"", "\"dinsdag 4 september 2012\\nMaterialen
  verzamelen\\nMaterialen verzamelen\\nIn deze tijd zijn er veel bedrijven die failliet\\ngaan,
  waaronder ook aannemers. Op het internet zijn er verschillende sites\\nwaarop je
  via internet kunt bieden op producten die als kavels verkocht worden.\\nGa je op
  iets via zo''n site bieden, wees dan zeker\\nvan wat\\nje koopt. Ga altijd eerst
  naar een kijkdag, zodat je weet wat de maten en\\nkwaliteit is van de producten
  en materialen. Heb je geboden dan kun je niet\\nmeer terug, tenzij anderen je overbieden.
  Ook is het slim om de prijs van de\\nproducten/materialen in de gewone handel te
  checken, want voordat je het weet\\nga je hoger dan je eigen had moeten bieden.\\nWij
  hebben zelf een aantal piketpalen, balkdragers\\nbetonvlecht matten, afstandsdragers
  en grote zeildoeken gescoord via zo''n\\nveiling, maar....als ik niet door iemand
  was overboden had ik ook met een\\nkozijn gezeten dat we achteraf niet wilden hebben!
  Dus KIJK UIT!\\nOok hebben we bij een bedrijf, waarmee we al eerder\\nzaken mee
  hadden gedaan, kunststofkozijnen kunnen scoren die ze over hadden\\n(door het afzeggen
  van een order vanwege faillissement).\\n1 groot kozijn met 5 ramen (van meer dan
  4 meter)\\nen 1 met 2 ramen.\\nGeen opmerkingen:\\nEen reactie plaatsen\"", "\"De
  gravinfluencer kan zich vooral druk maken om haar lichaam\\nEloise van Oranje deelt
  lief en leed met haar bijna 300 duizend volgers. Toch is Eloise niet altijd zo zelfverzekerd
  als ze zich voordoet op Instagram. In een eerlijk gesprek met LINDA.meiden vertelt
  ze over haar onzekerheden.\\nUiterlijk\\nEloise vertelt aan het blad dat ze zich
  vroeger weleens afvroeg of haar innerlijk wel leuk genoeg was. Gelukkig is ze nu
  een stuk zekerder over haar karakter en geeft ze aan dat het haar niet meer uitmaakt
  wat anderen van haar denken. Dit betekent echter niet dat Eloise helemaal geen onzekerheden
  heeft. De gravinfluencer geeft toe dat ze zich nu weleens onzeker voelt over haar
  uiterlijk. \u201cNiet over iets specifieks, meer typische dingen die ieder meisje
  heeft.\u201d\\nLichaam\\nHoewel Eloise dol is op mode \u2013 en er wat ons betreft
  altijd picobello uitziet \u2013 twijfelt ze weleens over haar outfits. De gravin
  is er dan mee bezig of iets haar wel \u2018mooi staat\u2019 en hoe haar lichaam
  erin uitkomt. \u201cHet is zeiken om niets.\u201d Toch vraagt Eloise zich regelmatig
  af waarom ze zich zo druk kan maken over haar voorkomen. \u201cWaarom denk ik dat
  mijn benen dik zijn? Ik sta er nu iets nuchterder in, maar natuurlijk heb ik soms
  mindere dagen\u201d, geeft Eloise toe. \u201cAls ik druk ben met school en dat negatieve
  stemmetje in mijn hoofd gaat zeuren. Dan luister ik naar wat mijn lichaam nodig
  heeft \u2013 als ik wil huilen, huil ik, en als ik een slechte serie wil kijken,
  doe ik dat.\u201d\\nDit bericht op Instagram bekijken\\nLees ook: Eloise van Oranje
  straalt als fashion queen op social media\"", "\"Vandaag is de nieuwe gelanceerd
  Live Y19s die geen volledige upgrade met zich meebrengt, maar wel een aantal belangrijke
  verbeteringen ten opzichte van zijn voorganger: een robuuster ontwerp, krachtige
  stereoluidsprekers en een grotere batterij.\\nVivo Y19s officieel met 5500mAh-batterij
  en ultrabestendig\\nDe Vivo Y19s heeft een LCD-scherm van 6,68 inch welke biedt
  er een 90Hz vernieuwingsfrequentie en een maximale helderheid van 1.000 nits in
  de hoge helderheidsmodus. Hoewel de resolutie nog steeds HD+ is, is de kijkervaring
  nog steeds aangenaam. Daar camera aan de voorkant zit nu in een gat, maar de resolutie
  gedaald naar 5 MP. Op de achterkant vinden we een 50MP hoofdsensor vergezeld van
  een extra camera. Een absolute nieuwigheid is deRGB LED-ring op het camera-eiland,
  dat van kleur verandert en kan worden gebruikt voor meldingen of om een vleugje
  stijl toe te voegen tijdens het afspelen van muziek.\\nOnder de motorkap wordt de
  Vivo Y19s aangedreven door de chipset Unisoc T612, een 12 nm-processor met twee
  Cortex-A75- en zes A55-cores, allemaal draaiend op 1,8 GHz, samen met een Mali-G57
  GPU. Deze chip is gekoppeld aan 6 GB LPDDR4X RAM en 128 GB eMMC 5.1 interne opslag.
  Het goede nieuws is dat de kaartlade twee nano-simkaarten en een microSD kan bevatten.
  Het apparaat wordt gestart met FuntouchOS 14 gebaseerd op Android 14.\\nDe Vivo
  Y19s is ontworpen om vallen te weerstaan en beschikt over een IP64-certificering,
  dat bescherming biedt tegen stof en fundamentele waterbestendigheid. Het apparaat
  is Voldoet aan de MIL-STD-810H-normen, die robuustheid en betrouwbaarheid biedt.\\nDe
  smartphone integreert een batterij van 5500 mAh ontworpen om lang mee te gaan, met
  behoud van ten minste 80% van de oorspronkelijke capaciteit na 1.460 oplaadcycli
  en ondersteunt een opladen vanaf 15W.\\nTenslotte is de Y19s uitgerust met stereo
  altoparlanti die tot 300% volume kan worden geduwd, een leuke toevoeging voor degenen
  die van luide audio houden. Bovendien is dat zo Er is een hoofdtelefoonaansluiting
  van 3,5 mm, een steeds zeldzamer maar gewaardeerde functie, gelegen naast de USB-C
  2.0-poort.\\nDe Vivo Y19s ligt nog niet in de winkels en er is geen offici\u00eble
  prijsinformatie, maar er wordt van uitgegaan dat het om een budgetmodel gaat.\"",
  "\"Onze Minister Kaag(D66) moet wel een vroom moslima zijn; dat kan haast niet anders.
  Tot ontsteltenis van veel landgenoten en hier opgevangen Iraanse vluchtelingen namelijk,
  heeft onze Minister van Buitenlandse Zaken de Nederlandse ambassadeur klaarblijkelijk
  eerder opgedragen om de inhuldiging van de nieuwe Iraanse president op 3 augustus
  j.l. bij te wonen.\\nEbrahim Raisi werd \u2018gekozen\u2019 als nieuwe president
  van Iran. De werkelijkheid is natuurlijk heel anders. In Iran is de hoogste islamitische
  geestelijke tevens leider van het land. Deze regeert volgens het principe van \u2018valajat-e
  fakih\u2019 ofwel het reg\u00e8ntschap van de rechtsgeleerde. Het woord \u2018reg\u00e8nt\u2019
  verwijst hier naar de plaatsvervanger van God op aarde. In Iran is dus, althans
  volgens degenen die erin trappen, als het ware God de baas. Onder de verantwoordelijkheid
  van de hoogste leider vallen onder andere de rechtspraak, het leger en controle
  over de media. Zo benoemt hij de opperrechter en de opperbevelhebber van het leger.
  De geestelijk leider heeft de macht de president te ontslaan. Daarnaast mag hij
  beslissingen van het parlement en/of president met een veto tegenhouden. In Iran
  is \u2018grootayatollah\u2019 Ali Hosseini Khamenei sinds 1989 de hoogste leider
  van Iran.\\nDeze geestelijk leider wordt bijgestaan door een raad van twaalf mannen,
  de Raad der Hoeders. Deze raad bestaat uit zes religieuze leden en zes rechters
  in het geestelijk recht, de sharia. Zij oefenen een enorme invloed uit en mogen,
  net als de Hoge Leider, beslissingen van het parlement met een veto tegenhouden.
  Ook bepalen zij welke politici aan verkiezingen mee mogen doen en welke niet. Dat
  heeft kortom, met democratie weinig te maken en ook in dit geval mocht de bevolking
  slechts naar de stembus om op \u00e9\u00e9n van de goedgekeurde kandidaten te stemmen.
  Dat die kandidaten vooraf, aan de \u2018chef namens God\u2019, al hebben beloofd
  zich aan de regels van zijn spel te zullen houden, als zij zouden worden \u2018gekozen\u2019,
  behoeft geen discussie.\\nDe situatie is dus, dat kan zelfs een kind nog zien, dat
  een stelletje godsdienstwaanzinnige gekken, door een hoge Nederlandse vertegenwoordiger
  werd gefeliciteerd met de aanstelling van een moordenaar, namelijk Ebrahim Raisi.
  Deze Raisi was van 1985 tot 1988 vice-procureur in de hoofdstad Teheran, eigenlijk
  meer een hele \u2018vieze procureur\u2019. Hij wordt door mensenrechtenorganisaties
  medeverantwoordelijk gesteld voor de executie van ten minste 4500 politieke gevangenen
  en dissidenten in de uitoefening van die functie.[1] En die moordenaar, die zonder
  blikken of blozen politieke tegenstanders uit de weg ruimde, werd dus namens Nederland
  gefeliciteerd met zijn nieuwe functie. Een land waar wekelijks personen uit de lokale
  LGBT-gemeenschap (Lesbisch, Gay, Biseksueel en Transgender) worden opgehangen, zou
  toch wat meer tegenspel mogen hebben van onze Minister, wier partij in eigen land
  zo begaan is met het lot van \u2018die mensen\u2019.\\nHet is natuurlijk onbestaanbaar
  dat een Nederlandse vertegenwoordiger bij de feestelijk inhuldiging van een massamoordenaar
  aanwezig is. Sterker: Nederland zou helem\u00e1\u00e1l geen ambassade moeten hebben
  in een land wat wordt geregeerd door moordenaars en godsdienstwaanzinnigen.\\nMet
  het opheffen van onze ambassade in Teheran, kunnen we mevrouw \u201cwie zijn die
  mensen\u201d Kaag maar beter uitwijzen naar datzelfde Teheran. Ze zal het daar vast
  wel naar haar zin hebben.\\n[1] \u2018Ebrahim Raisi heeft duizenden politieke gevangenen
  laten executeren\u2019, Trouw, 18 juni 2021\\nIk denk dat het staand beleid is om
  diplomatieke contacten te onderhouden met alle massamoordende regimes in de wereld,
  dus ook Iran.\"", "\"Mientras duermes (2011)\\nAlternatieve titel(s): Sleep Tight\\n-
  Jaar, land 2011 Spanje\\n- Speelduur 96 minuten\\n- Regisseur Jaume Balaguer\u00f3\\n-
  Acteurs Bekijk alle acteurs\\n- Releasedatum (Nederland)\\n- Meer informatie IMDb\\n-
  Delen\\nC\u00e9sar werkt als doorman in een appartementencomplexin Barcelona. Geen
  van de bewoners merkt hem op, maar hij weet wel alles van de bewoners omdat hij
  ze dagelijks ziet en alles in de gaten houdt. Hij is vooral ge\u00efnteresseerd
  in een bewoner, Clara, wiens optimistische levensvisie C\u00e9sar irriteert...\\nTrailer\\nTrailer\\nWatchlist
  (7)\\nGezien (6)\\nExterne recensies\"", "\"Nieuws\\nSamen sterk voor Borstvoeding\\nVan
  1 tot en met 7 augustus a.s. is het weer Wereld Borstvoedingsweek. Dit keer is het
  thema \u2018Samen sterk voor borstvoeding\u2019. Een mooi en inspirerend thema,
  als je het mij vraagt. Want iedereen in de omgeving van een..\\nBekijk het hele
  artikelEen verliefde baby!!??\\nTijdens de zwangerschapscontroles komen er regelmatig
  broertjes of zusjes mee. Vooral kleuters en oudere kinderen vinden het vaak heel
  interessant om te zien wat er allemaal gedaan wordt: bloeddruk meten, hartje luisteren
  en soms een echo maken. Als verloskundige vind..\\nBekijk het hele artikelWat? Een
  wespennest in je vagina\u2026?\\nOp internet wordt echt van alles verkocht. Zelfs
  speciale bolletjes gemaakt van wespennesten. Door deze bolletjes \u2013 gelukkig
  zonder wespen! \u2013 in te brengen, zou je vagina op wonderbaarlijke wijze strakker
  en schoner worden. Toen ik dit las op internet,..\\nBekijk het hele artikelTENS
  apparaten te huur bij ons\\nBen je op zoek naar een veilige manier van pijnbestrijding
  die je zowel thuis als in het ziekenhuis kunt gebruiken? Dan is de TENS misschien
  iets voor jou! TENS staat voor \u201cTranscutane Electrische Neuro Stimulatie\u201d
  en werkt met kleine stroomstootjes..\\nBekijk het hele artikelFacebookactie juni\\nOnze
  praktijk bestaat dit jaar 60 jaar. En \u201cWie jarig is, trakteert!\u201d, daarom
  houden we een aantal acties op Facebook waarbij leuke prijzen te winnen zijn. Deze
  maand maak je kans op een cursus \u2018Babymassage en voetreflexmassage\u2018 (4
  lessen) t.w.v...\\nBekijk het hele artikelVoel jij je ook als een vis in het water?\\nMooi
  h\u00e9 dit filmpje! Je kunt goed zien hoe de orka gebruik maakt van haar bewegingsvrijheid.
  Wist je dat hierdoor de bevalling vaak vlotter verloopt?! Je kunt hier zelf ook
  gebruik van maken. Ga juist lopen, hangen, zitten,..\\nBekijk het hele artikelFacebookactie
  mei\\nHoera, wij zijn jarig! Daarom trakteren wij via een Like, Deel & Win-actie
  op onze Facebookpagina. De Babyplanners bieden je een intakegesprek en een ontwerp
  van een geboortekaartje speciaal voor jullie (of iemand die je kent en zwanger is),
  hoe..\\nBekijk het hele artikelUitgebreide zwangerschapscontroles\\nSteeds meer
  zwangeren en hun partners binnen onze praktijk nemen deel aan CenteringPregancy.
  Dit zijn extra uitgebreide zwangerschapscontroles waarbij je veel meer leert over
  uiteenlopende onderwerpen. In de onderstaande vlog laten we zien wat zwangeren in
  de zevende bijeenkomst doen..\\nBekijk het hele artikelFacebookactie april\\nOnze
  praktijk bestaat dit jaar 60 jaar en dit laten we natuurlijk niet onopgemerkt voorbij
