  "\"Schilderijenroof mogelijk compensatie voor onderschepte partij coca\u00efne\\nEr
  bestaat een mogelijkheid dat de schilderijenroof uit de Kunsthal bedoeld is al financi\u00eble
  compensatie voor de criminelen die onlangs 8000 kilo coca\u00efne aan hun neus voorbij
  zagen gaan. Dit heeft beveiligingsspecialist Ton Cremers tegen EenVandaag gezegd.\\nOok
  hier zou er een verband zijn met grote partijen drugs die vlak voor de kunstroven
  door justitie werden onderschept. De criminelen zouden volgens Cremers met de gestolen
  kunst de onderhandeling met de verzekeringsmaatschappijen willen aangaan om zo toch
  nog geld te kunnen verdienen om de mislukte drugssmokkel te compenseren.\\nMegavangst:
  8000 kilo coca\u00efne\\nDinsdag 9 oktober hield de Nationale Recherche vijf mannen
  aan nadat een dag eerder in de haven van Antwerpen door de douane een recordvangst
  van 8000 kilo coca\u00efne met bestemming Nederland was gedaan. De groothandelswaarde
  van de enorme partij coca\u00efne, die verstopt zat onder een lading bananen, is
  ongeveer 280 miljoen euro.\\nHet drugstransport kwam maandag 8 oktober in de haven
  van Antwerpen aan op een vrachtschip uit Ecuador. De container met fruit, die was
  bestemd voor een bedrijf in Zoetermeer, werd dinsdag aan het einde van de middag
  afgeleverd op het industrieterrein Spaanse Polder in Rotterdam. Het transport was
  gevolgd door de politie.\\nDe Nationale Recherche hield behalve de 46-jarige chauffeur
  uit Belgi\u00eb nog vier mannen uit Rotterdam aan toen de container werd uitgeladen.
  Deze verdachten zijn vrijdag 12 oktober reeds voorgeleid aan de rechter-commissaris
  in Rotterdam.\\nDe straatwaarde van zo''n omvangrijke partij coca\u00efne is meer
  dan een half miljard euro. In Nederland zijn eerder megavangsten coca\u00efne gedaan:
  4000 kilo in Vlissingen in 2000 en 4600 kilo in Rotterdam in 2005.\\nDoor de Nationale
  Recherche wordt verder onderzoek gedaan naar de uiteindelijke bestemming, de financiering
  en de opdrachtgevers van het drugstransport.\"", "\"De geschiedenis van de EBG\\nDe
  Evangelische Broedergemeente Zeist is gevestigd in de monumentale gebouwen op het
  Broeder- en Zusterplein, die langs de oprijlaan van het Slot Zeist zijn te vinden.
  Samen met het Slot vormen deze historische panden een uniek architectonisch geheel.\\nDe
  oorsprong van de Evangelische Broedergemeente ligt in het voormalige Tsjechoslowakije,
  namelijk in Moravi\u00eb en Bohemen. In de 15e eeuw ontstond daar, na de reformatie,
  een nieuwe kerk, die als voorloper beschouwd kan worden van de Reformatie. Laatste
  bisschop van de reformatie was de beroemde theoloog en pedagoog Jan Amos Komensky
  (Comenius) die in 1670 in Amsterdam overleed en in Naarden begraven ligt.\\nIn de
  18e eeuw waren er nog enkele volgelingen over die leefden in het grensgebied tussen
  Saksen (Duitsland) en Moravi\u00eb (Tsjechi\u00eb). Dezen werden streng vervolg.
  Een aantal gezinnen vluchten toen naar Saksen waar zij zich mochten vestigen op
  het landgoed van Graaf Nikolaus Ludwig von Zinzendorf. Hier ontstond in 1722 de
  nederzetting Herrnhut, die uitgroeide tot de hernieuwde Broederuniteit of Evangelische
  Broedergemeente. Vanuit Herrnhut werden op diverse plaatsen in Europa Broedergemeenten
  gesticht.\\nSnel na het ontstaan van de Broederuniteit trokken de eerste zendelingen
  de wereld over om het evangelie te verkondigen. In tegenstelling tot Europa groeiden
  deze zendingsposten uit tot ware volkskerken zoals bijvoorbeeld in Suriname en Tanzania.\\nOm
  ook in Indi\u00eb het Evangelie te kunnen verkondigen,\\nvestigden de Herrnhuters
  zich ook in Nederland. Hier ontmoetten ze\\nenkele doopsgezinden die zich tot de
  Broedergemeente aangetrokken\\nvoelden. Toen Zinzendorf in 1736 naar Nederland kwam,
  sloten deze\\ndoopsgezinden zich bij de Broedergemeente aan. Zij maakten het mogelijk\\ndat
  de Broedergemeente zich in Zeist kon vestigen en gingen er zelf ook\\nwonen.\\nIn
  1745 kregen de Herrnhutters toestemming van de Heer van\\nZeist, Cornelis Schellinger,
  om zich in de tuinen van Slot Zeist te\\nvestigen, waar vervolgens het Broeder-
  en Zusterplein ontstonden.\\nHet Hernhutter Huis\\n\u2018Het Hernhutter Huis\u2019
  is een museumstichting die zich ten doel stelt om de geschiedenis van de Broedergemeente
  en het ZZg te presenteren. Zij streeft daartoe naar een permanente vestiging van
  een museum in Zeist, mogelijk in samenwerking met andere historische instellingen.
  Vanuit de stichting worden exposities samengesteld en wordt de voorwerpencollectie
  verder uitgebouwd en in kaart gebracht. In het dienstencentrum beschikt de stichting
  over een expositieruimte. Tevens worden er ieder jaar vanaf half oktober hernhutter
  sterren verkocht vanuit de expositieruimte. De sterren zijn ook te bestellen via
  de website: www.hernhuttersterren.nl \u00bb contact\"", "\"Datum/Tijd\\nDate(s)
